div.div:
void history_start(HistoryItem item) {
...
if (history_empty())
{
item.on_create(item.self); history_push(item);
item.on_resume(item.self);
return;
} ...
}

void history_back() {
...
top = history_peek();
top.on_pause(top.self);
history_pop();
top.on_destroy(top.self);
if (history_empty()) {
return;
} ...
}
